             82 CALL_FUNCTION            1
             85 POP_TOP
             86 LOAD_CONST               5 (None)
             89 RETURN_VALUE

通过该字节码指令可知，创建 set 调用了 BUILD_SET 指令，初始化完成之后，就调用 set 的 add 方法添加元素，调用 remove 删除元素,调用 update 来更新集合，通过 union 来合并集合。接下来就详细分析一下相关的操作流程。
